import React from 'react';

const MealItem = (props) => {
  return (
    <li>
      <div>
        <h2>{props.name}</h2>
        <p>{props.description}</p>
        <h2>{props.price}</h2>
      </div>
    </li>
  );
}

export default MealItem;
